import React from "react";

const SvgLogo = props => (
  <svg viewBox="0 0 613 572" {...props}>
    <text
      transform="translate(289 560)"
      style={{
        isolation: "isolate"
      }}
      fontSize={56.142}
      fill="#010101"
      fontFamily="HiraginoSansGB-W3-GBpc-EUC-H,Hiragino Sans GB"
      letterSpacing="-.023em"
    />
    <text
      transform="translate(595 555)"
      style={{
        isolation: "isolate"
      }}
      fontSize={56.142}
      fill="#010101"
      fontFamily="HiraginoSansGB-W3-GBpc-EUC-H,Hiragino Sans GB"
      letterSpacing="-.023em"
    />
    <path
      d="M-638-250h0M220 11h9M220 11h14"
      fill="none"
      stroke="#d22026"
      strokeWidth={21.254}
    />
  </svg>
);

export default SvgLogo;
